    0%{
        opacity: 0;
    }
    100%{
        opacity: 1;
    }
}

.grid{
    @include mixins.margem-central(80%);
    text-align: center;
    margin-top: 4rem;

    @include mixins.lg {
        margin-top: 10rem;
    }

    .tag{
        @include mixins.tag;
        &:after{
            @include mixins.line;
            margin: 1rem auto 2rem auto;
        }
    }
    &__title{
        margin: 0 auto;

        @include mixins.lg {
            max-width: 750px;
        }
    }
    .grid__gallery{
        margin-top:2.5rem;
        /* @include mixins.margem-central(80%); */

        @include mixins.lg {
            margin-top: 5rem;
        }

        .gallery-menu{
            border: 5px solid var.$color-lighter-gray;
            padding: 0 5rem;
            border-radius: var.$border-radius;
            cursor: pointer;
            @include mixins.ff-fs-cl-fw-line(var.$font, 1.1rem, var.$color-dark-gray, 3.12rem, 500);

            @include mixins.xl{
                display: inline-flex;
                gap: 10rem;
            }
        }
        .gallery-menu__item--active{
            color: var.$primary-color;
            &:after{
                content: "";
                display: block;
                background: var.$primary-color;
                width: 105px;
                height: 5px;
                border-radius: var.$border-radius;
                margin: 0 auto;

                @include mixins.lg {
                    margin-bottom: -3px;
                }
            }
        }
    }
    &-imgs{
        margin: 20px 0 0 0;
        /* -webkit-column-count: 1;
